import { Decrement } from '../number';
import { ZeroTo10 } from '../constants';
export type Merge<A, B, Depth extends ZeroTo10 = 1> = [A, B] extends [Record<string, any>, Record<string, any>] ? Depth extends 1 ? Pick<A, Exclude<keyof A, keyof B>> & B : Pick<A, Exclude<keyof A, keyof B>> & Pick<B, Exclude<keyof B, keyof A>> & {
    [key in keyof A & keyof B]: Merge<A[key], B[key], Decrement<Depth>>;
} : B;
